import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M9.63 5.07a5.5 5.5 0 00-3.3 1.85 2.75 2.75 0 113.3-1.85zM5.6 8a5.48 5.48 0 00.62 5.96C3.55 13.66 2 11.8 2 10v-.5C2 8.67 2.67 8 3.5 8h2.1zm4.9 7a4.5 4.5 0 100-9 4.5 4.5 0 000 9zm0-7c.28 0 .5.22.5.5V10h1.5a.5.5 0 010 1H11v1.5a.5.5 0 01-1 0V11H8.5a.5.5 0 010-1H10V8.5c0-.28.22-.5.5-.5z", fill: primaryFill }));
};
const PersonAdd16Filled = wrapIcon(rawSvg({}), 'PersonAdd16Filled');
export default PersonAdd16Filled;
